create table t_real_check_point
(
    id                     BIGINT(19) auto_increment
        primary key,
    real_task_id           BIGINT(19)   null comment '任务id',
    longitude              VARCHAR(100) null,
    latitude               VARCHAR(100) null,
    name                   VARCHAR(100) null,
    remark                 TEXT(65535)  null,
    jurisdiction           BIGINT(19)   null,
    create_time            BIGINT(19)   null,
    creator                BIGINT(19)   null,
    update_time            BIGINT(19)   null,
    updater                BIGINT(19)   null,
    scope                  VARCHAR(255) null,
    sort                   BIGINT(19)   null,
    point_id               BIGINT(19)   null,
    task_instance_point_id BIGINT(19)   null
)
    collate = utf8_bin;

